import React from 'react';
import {
  ChakraProvider,
  Box,
  Container,
  Heading,
  Text,
  extendTheme
} from '@chakra-ui/react';

function App() {
  const config = {
    initialColorMode: "light",
    useSystemColorMode: false,
  }

  const theme = extendTheme({ config })

  return (
    <ChakraProvider theme={theme}>
      <Heading color="black" fontSize="5xl" textAlign="center" mt={0} minW="100vw" bg = "white">
        Image Compression
      </Heading>
      <Box>
      halo
      </Box>

    </ChakraProvider>
  );
}

export default App;
